#Get status include regional variation
regVarInclude = value['regVar']

#Loop through Ids and constrcut options list
options = []
for id in value['ids']:
	if regVarInclude:
		if id['country'] == "":
			option = {'value':id['local'],
								  'label':id['language']}
			options.append(option)
		else:
			option = {'value':id['local'],
					  'label':id['language'] + ' (' + id['country'] + ')'}
			options.append(option)
	elif id['country'] == "":
		option = {'value':id['local'],
				  'label':id['language']}
		options.append(option)
return options
